import React, { Component } from 'react';
import './index.css';
import { CookiesProvider } from 'react-cookie';
import MyRoute from '../Route';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      client: new AccountClient('http://localhost:8080')
    }
  }

  render() {
    return(
      <CookiesProvider>
        <MyRoute />
      </CookiesProvider>
    );
  }
}

export default App;
